import axios from "axios";
const Post = () => {
  return <h1>You clicked on Post </h1>;
};

Post.getInitialProps = async ({ query }) => {
  axios.get("https://jsonplaceholder.typicode.com/comments?postId=" + query.id);
  return { query };
};
export default Post;
